    private static void buildFromMysql() {
        ShopifyurlsJpaController control = new ShopifyurlsJpaController(emf);
        List<Shopifyurls> urls = control.findShopifyurlsEntities();
        List<Document> docs = new ArrayList<>();
        urls.stream().forEach(url -> {
            String json = Utilities.gson(url);
            int start = json.indexOf("producttype");
            Document doc = Document.parse("{\"".concat(json.substring(start)));
            docs.add(doc);
        });
        MongoDBJDBC.addDocuments("shopifyurls", docs);
    }

    private static void ShopifyToMongo() {
        Map<String, String> params = new HashMap<>();
        params.put("fields", "id,title,published_at,product_type,variants");
        //params.put("id", "8199327687");
        int page = 0;
        int limit = 50;
        params.put("limit", "50");
        Collection<Document> shopifies = new ArrayList<>();
        while (limit == 50) {
            params.put("page", ++page + "");
            String json = RestClient.getProducts("prod", params);
            Document doc = Document.parse(json);
            if (doc.containsKey("product")) {
                shopifies.add((Document) doc.get("product"));
                limit = doc.size();
            } else {
                Collection<Document> products = (Collection<Document>) doc.get("products");
                products.stream().forEach(shopifies::add);
                limit = products.size();

            }
            System.out.print("*");
        }
        Collection<Document> notInMongo = new ArrayList<>();
        shopifies.stream().forEach(p -> {
            List<Document> variants = (List<Document>) p.get("variants");
            variants.stream().forEach(v -> {
                Bson bson = Filters.and(Filters.eq("productId", "" + p.get("id")), Filters.eq("variantId", "" + v.get("id")));
                Collection<Document> product = MongoDBJDBC.filterCollection("shopifyurls", bson);
                if (product.isEmpty()) {
                    notInMongo.add(p);
                }
            });
            System.out.print("+");
        });
        System.out.println("size:" + notInMongo.size());
        notInMongo.stream().forEach(System.out::println);
    }

