    private static void importShopifyProducts() {
        Map<String, String> params = new HashMap<>();
        params.put("fields", "id,title,published_at,product_type,variants");
        //params.put("id", "8199327687");
        int page = 0;
        int limit = 50;
        params.put("limit", "50");
        Collection<Document> shopifies = new ArrayList<>();
        while (limit == 50) {
            params.put("page", ++page + "");
            String json = Utilities.normalizeNumbers(RestClient.getProducts("prod", params).replaceAll("\"id\":", "\"_id\":"), new String[]{"barcode"});
            System.out.println(json);
            Document doc = Document.parse(json);
            if (doc.containsKey("product")) {
                shopifies.add((Document) doc.get("product"));
                limit = doc.size();
            } else {
                Collection<Document> products = (Collection<Document>) doc.get("products");
                products.stream().forEach(shopifies::add);
                limit = products.size();

            }
            shopifies.stream().forEach(p -> {
                //MongoDBJDBC.addDocument("products", p);
                Bson bson = Filters.eq("productId", p.getLong("_id"));
                MongoDBJDBC.upsertDocument("products", bson, p);
            });
            shopifies.clear();
            System.out.print("*");
        }
    }
